from Crypto.Cipher import AES

encrypted = ""
#on convertit encrypted en bytes
encrypted = bytes.fromhex(encrypted)

#x^y=s
#fonction qui xor deux tableaux d'array
def xor_bytes(byte_array1, byte_array2):
    return bytes(x ^ y for x, y in zip(byte_array1, byte_array2))


png_magics_number = bytes([0x89, 0x50, 0x4e, 0x47, 0x0d, 0x0a, 0x1a, 0x0a, 0x00, 0x00, 0x00, 0x0d, 0x49, 0x48, 0x44, 0x52])
ciphertext_magics_number = encrypted[:len(png_magics_number)]
key1 = xor_bytes(png_magics_number, ciphertext_magics_number)

decrypted_data = xor_bytes( encrypted, key1*( len(encrypted) // len(key1) ) )
# ci dessus( len(encrypted) // len(key1) ) me permet de connaitre le nombre de fois qu'on peut avoir key1 dans encrypted

with open("image.png", "wb") as f:
    f.write(decrypted_data)
